import Vue from 'vue';
import FiveDayForecast from 'FiveDayForecast.vue';
import MySavedLocations from 'MySavedLocations.vue';

const routes = [
  {
    path: '/5day',
    name: 'FiveDayForecast',
    component: FiveDayForecast,
    props: true, 
  },

  {
    path: '/saved-locations',
    name: 'SavedLocations',
    component: MySavedLocations,
  },

];

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
